import Card from "../Card/Card";
import style from './Cards.module.css'

export default function Cards(props) {
   const { characters, onClose } = props;
   return (
   <div className={style.container}>
     <h1>Cards</h1>
    {characters?.map(
      ({id,name,species,status,gender,origin,image}) =>(
         <Card
            key={id}
            id={id}
            name={name}
            status={status}
            species={species}
            gender={gender}
            origin={origin.name}
            image={image}
            onClose={onClose}
         />
      )
    )}
   </div>
   );
}
